import React, { Component } from 'react';
import { Div, Div3,H1 ,P} from '../styles/styles';

class InterfaceRegistro extends Component {
    render() {
        return (
           
            <Div3>
                <H1>Welcome back</H1>
         
                <P>Sign in to an existing account
                    using your phone number</P>
            </Div3>
        
        )
    }
}

export default InterfaceRegistro;
